import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import useMyList from "./f"; // Corrected import statement
import mylistsscreen from "./Mylistsscreen"
import Footer from "./Footer";



function MyList() {

    const myListDetails = useMyList(); // Changed variable name to match the function name

    return (
      <>
      <Container>
        <br />
        <h1>My List </h1>
        <Row>
          {myListDetails.map((product) => (
            <Col key={product._id} sm={12} md={6} lg={4} xl={3}>
              <mylistsscreen product={product} />
            </Col>
          ))}
        </Row>
      </Container>
      <Footer /> {/* Include Footer component here */}
    </>
    );
}

export default MyList;
